INSERT INTO `dba_sections` VALUES (1,2,4,'Home','Home','Home','Home','','','#index',0,'','',NULL,'',0,1,1,0,0,0,1,1,1,'2018-03-05 17:17:18','2023-03-09 14:35:25',1),(2,2,4,'Iniciar Sesión','Iniciar Sesión','Iniciar Sesión','Iniciar Sesión','','','#login',0,'','Ingrese su email y contraseña',NULL,'',0,0,0,0,0,0,0,0,2,'2018-03-05 17:17:18','2020-06-22 20:04:25',1),(3,2,4,'Registro','Formulario de registración','registro','registro','registro','','',0,'','',NULL,'Complete el formulario. La contraseña debe tener un mínimo de 6 caracteres y un máximo de 12, debe contener al menos 1 número, una letra mayúscula y una letra minúscula.<br />\r\nRegistrarse presupone estar de acuerdo con los <a class=\"btn-clean-white\" href=\"[[[CONFIG_HOST_NAME_FRONTEND]]]sections/terminos-y-condiciones/\">términos y condiciones</a>.',2,0,0,0,0,0,0,0,3,'2018-03-05 17:17:18','2020-06-29 22:30:41',1),(4,2,4,'Perfil','Perfil','perfil','perfil','perfil',NULL,NULL,0,NULL,'',NULL,NULL,0,0,0,0,0,0,0,0,4,'2018-03-05 17:17:18','2018-03-05 17:17:18',1),(5,2,4,'Recuperar contraseña','Recuperar contraseña','','','recuperar-contraseña','','',0,'','',NULL,'<p>Si olvido su contraseña, ingrese su email y le enviaremos a su email instrucciones para poder cambiarla.</p>',0,0,0,0,0,0,0,0,5,'2018-03-05 17:17:18','2020-07-04 19:52:16',1),(6,2,4,'Cambiar contraseña','Cambiar contraseña','','','cambiar-contraseña','','',0,'','',NULL,'<p>Para blanquear o cambiar la contraseña complete el formulario.<br />\r\nRecuerde que la contraseña debe tener un mínimo de 6 caracteres y un máximo de 12, debe contener al menos 1 número, una letra mayúscula y una letra minúscula.</p>',0,0,0,0,0,0,0,0,6,'2018-03-05 17:17:18','2020-07-04 19:47:42',1),(7,2,4,'Pagina de error','Pagina de error','Pagina de error',NULL,'error',NULL,NULL,0,NULL,NULL,NULL,NULL,0,0,0,0,0,0,0,0,7,'2018-03-05 17:17:18','2018-03-05 17:17:18',1),(8,2,4,'Términos y Condiciones','Términos y Condiciones','Términos y Condiciones','','terminos_y_condiciones','',''