CREATE TABLE `dba_sections_heros` (
  `id_seccion_hero` int NOT NULL AUTO_INCREMENT COMMENT 'hidden;true;true;Id;',
  `id_setting_country_language` int NOT NULL DEFAULT '2' COMMENT 'select;false;false;Language; SELECT * FROM dba_settings_countries_languages;',
  `id_section` int NOT NULL DEFAULT '1' COMMENT 'select;false;false;Secctions; SELECT * FROM dba_sections;',
  `name` varchar(255) DEFAULT NULL COMMENT 'varchar;true;true;Name;',
  `greeting_show` tinyint(1) NOT NULL DEFAULT '0' COMMENT 'checkbox;true;true;Greeting Show;',
  `greeting_text` text COMMENT 'richtext;false;true;Greeting Text;',
  `detail` text COMMENT 'richtext;false;true;Detail;',
  `file_desktop` varchar(255) DEFAULT NULL COMMENT 'file;true;true;Desktop (1920x1080);;80:0:1920:true',
  `file_tablet_portrait` varchar(255) DEFAULT NULL COMMENT 'file;true;true;Tablet Portrait (768x1024);;80:0:768:true',
  `file_tablet_landscape` varchar(255) DEFAULT NULL COMMENT 'file;true;true;Tablet Landscape (1024x768);;80:0:1024:true',
  `file_mobile_portrait` varchar(255) DEFAULT NULL COMMENT 'file;true;true;Mobile Portrait (780x1688);;80:0:780:true',
  `file_mobile_landscape` varchar(255) DEFAULT NULL COMMENT 'file;true;true;Mobile Landscape (1024x768);;80:0:1024:true',
  `boton_show` tinyint(1) NOT NULL DEFAULT '0' COMMENT 'checkbox;true;true;Botton Show;',
  `boton_text` varchar(255) DEFAULT NULL COMMENT 'varchar;true;true;Botton Text;',
  `boton_url` varchar(255) DEFAULT NULL COMMENT 'varchar;true;true;Botton URL;',
  `field_order` int DEFAULT NULL COMMENT 'order;true;true;Order;',
  `date` date NOT NULL DEFAULT '2020-01-01' COMMENT 'hiddendate;false;true;Creation At;',
  `modified` time NOT NULL DEFAULT '00:00:00' COMMENT 'hiddentime;false;true;Update At;',
  `status` tinyint(1) NOT NULL DEFAULT '1' COMMENT 'tinyint;true;false;Status;',
  PRIMARY KEY (`id_seccion_hero`),
  KEY `ky_setting_country_language` (`id_setting_country_language`),
  KEY `ky_section` (`id_section`)
) ENGINE=MyISAM AUTO_INCREMENT=2 DEFAULT CHARSET=utf8mb3 COMMENT='true;true;false;son_of:sections;Hero';

INSERT INTO `dba_sections_heros` VALUES (1,2,1,'Hero 1',0,'<h1 class=\"ah-headline\">\r\n <span class=\"ah-words-wrapper\">\r\n  <b class=\"is-visible\">Desarrollo a medida,</b>\r\n  <b>Diseño Web,</b>\r\n  <b>Diseño Gráfico.</b>\r\n </span>\r\n</h1>','<p class=\"animatedTop\">¿Necesitas un desarrollo personalizado? ¿Tu sitio web ? ¿Tu\r\n tienda online?<br>\r\n ¿Necesitas integrar tu sistema de Stock? Si la respuesta es sí, estas en el lugar\r\n correcto.\r\n</p>','01042023_201937_15395230.jpg','01042023_201937_16224070.jpg','01042023_201937_19024012.jpg','01042023_201938_17545182.jpg','01042023_201938_18355658.jpg',0,NULL,NULL,1,'2023-04-01','20:10:14',1);

CREATE TABLE `dba_settings` (
  `id_setting` int NOT NULL AUTO_INCREMENT COMMENT 'hidden;true;true;Id;',
  `id_country` int NOT NULL DEFAULT '2' COMMENT 'select;false;true;Country; SELECT * FROM dba_countries;',
  `id_setting_language` int NOT NULL DEFAULT '2' COMMENT 'select;false;true;Language; SELECT * FROM dba_settings_languages;',
  `name` varchar(150) DEFAULT NULL COMMENT 'varchar;true;true;Name;',
  `detail` text COMMENT 'text;false;true;Detail;',
  `keywords` varchar(150) DEFAULT NULL COMMENT 'varchar;false;true;Keywords;',
