 />\r\nte desea un<br />\r\nbuen viaje.</p>','2019-04-07 20:01:08','2019-04-07 20:01:08',1),(177,2,'home_hero_title','<p>NUESTRO SUEÑO</p>','2019-04-07 20:01:08','2020-06-19 19:36:51',1),(178,2,'home_hero_detail','<p>Cabañas Nuestro Sueño -&nbsp;Mar del Plata - Argentina</p>','2019-04-07 20:01:08','2020-06-19 19:37:16',1),(179,2,'home_hero_button','<p>Ver Cabañas</p>','2019-04-07 20:01:08','2020-06-19 19:38:35',1),(180,2,'home_us_title','<p>Alquiler temporario de cabañas.</p>','2019-04-07 20:01:08','2020-06-19 19:40:44',1),(181,2,'home_us_detail','<p><strong>“CABAÑAS NUESTRO SUEÑO”</strong><br />\r\nEs un complejo de 4 cabañas que nació como un sueño y está construído como tal. Por eso los atendemos de forma personalizada, siendo nuestro compromiso brindarles un lugar cálido, confortable, tranquilo, con buenas energías y un ambiente familiar, para que su estancia sea placentera e inolvidable. Las mascotas también son bien recibidas!! Contamos con que sus dueños sabrán hacerse cargo de ellas.</p>\r\n\r\n<p>Estamos ubicados en Pesquero Quo Vadis 3646 zona sur de Mar del Plata. Altura Jorge Newbery 3600. Próximos al Bosque Peralta Ramos y a las Av. Edison y Mario Bravo.</p>\r\n\r\n<p>El Barrio es muy tranquilo, y más aún nuestro complejo que está completamente cerrado y seguro ya que nos encontramos sobre una calle sin salida.</p>\r\n\r\n<p><strong>Todas las cabañas están completamente equipadas:</strong><br />\r\n• Microondas&nbsp; •&nbsp;Cafetera&nbsp; •&nbsp;Pava&nbsp; •&nbsp;Juguera&nbsp; •&nbsp;Vajilla completa&nbsp; •&nbsp;Cocina con horno&nbsp; •&nbsp;Heladera&nbsp; •&nbsp;Ventilador&nbsp; •&nbsp;Calefactor&nbsp; •&nbsp;Equipo de música&nbsp; • WIFI&nbsp;•&nbsp;TV&nbsp; •&nbsp;Reproductor de DVD&nbsp; •&nbsp;Películas&nbsp; •&nbsp;Juegos de mesa&nbsp; •&nbsp;Luz de emergencia</p>\r\n\r\n<p><strong>Incluye:</strong><br />\r\n•&nbsp;Desayuno seco&nbsp;&nbsp;•&nbsp;Ropa de Cama&nbsp;&nbsp;•&nbsp;Toallas y Toallones&nbsp;&nbsp;•&nbsp;Mantel</p>\r\n\r\n<p><strong>En el exterior contamos con:</strong><br />\r\n•&nbsp;Parrilla Individual&nbsp;&nbsp;•&nbsp;Quincho&nbsp;&nbsp;•&nbsp;Mesas y sillas de plástico&nbsp;&nbsp;•&nbsp;Juegos de jardín para niños&nbsp;&nbsp;•&nbsp;Lugar para vehículos dentro del predio<br />\r\nLas cabañas son muy luminosas y cuentan con cortinas blackout. Decoradas en madera para lograr la calidez necesaria para el relax.</p>','2019-04-07 20:01:08','2020-06-19 19:41:18',1),(182,2,'home_us_button','<p>¡Reserve su cabaña ahora!</p>','2019-04-07 20:01:08','2020-06-19 19:41:40',1),(183,2,'home_cabanas_titulo','<p>Nuestras Cabañas</p>','2019-04-07 20:01:08','2019-04-07 20:01:08',1),(184,2,'home_how_reach_title','<p>¿Queres saber cual es la mejor ruta para llegar al complejo?</p>','2019-04-07 20:01:08','2020-06-19 19:43:19',1),(185,2,'home_how_reach_detail','<p>Usa nuestro mapa interactivo y te indicaremos como llegar.</p>','2019-04-07 20:01:08','2020-06-19 19:43:41',1),(186,2,'home_how_reach_button','<p>Ver mapa interactivo</p>','2019-04-07 20:01:08','2020-06-19 19:44:12',1),(187,2,'home_contct_detail','<p>El complejo se ocupa rápido le pedimos reserve con antisipación más si son feriados largos y verano. Antisipece y contactese ahora!</p>','2019-04-07 20:01:08','2020-06-19 19:45:02',1),(188,2,'home_contact_title','<p>¡Reserve su cabaña ahora!</p>','2019-04-07 20:01:08','2020-06-19 19:44:39',1),(189,2,'contacto_titulo','<p>Contactános</p>','2019-04-07 20:01:08','2019-04-07 20:01:08',1),(190,2,'contacto_detalle','<p>Contactese con nosotros.</p>','2019-04-07 20:01:08','2019-04-07 20:01:08',1),(191,2,'mapa_interactivo_titulo','<p>Mapa Interactivo</p>','2019-04-07 20:01:08','2019-04-07 20:01:08',1),(192,2,'mapa_interactivo_subtitulo','<p>Instrucciones:</p>','2019-04-07 20:01:08','2019-04-07 20:01:08',1),(193,2,'mapa_interactivo_detalle','<ul>\r\n	<li>Ingresa una dirección</li>\r\n	<li>Presiona el boton \"Ver\"</li>\r\n	<li>Si es la dirección presiona el botón \"Continuar\" Si no es la dirección vuelve al punto 1</l