CREATE TABLE `dba_users_carts` (
  `id_user_cart` int NOT NULL AUTO_INCREMENT COMMENT 'hidden;true;true;Id;',
  `id_user_cart_estate` int DEFAULT NULL COMMENT 'select;false;true;Cart State; SELECT * FROM dba_users_carts_states;',
  `id_product` int DEFAULT NULL COMMENT 'select;false;true;Product; SELECT * FROM dba_products;',
  `id_user` int DEFAULT NULL COMMENT 'select;false;true;User; SELECT * FROM dba_users;',
